import React from 'react'

import  './Button.css'
import classes from "../../containers/buttonList/buttonList.css";

const button = ( props ) => {
    // let style = {};
    // if (props.value==='=') {
    //     style['color'] = '#0CB999';
    // }

    return (<input type="button"
                   id={props.id}
                   value={props.value}
                   onClick={props.clicked} style={JSON.parse(props.style)}/>);
};
export default button;
